apiVersion: v1
clusters:
- cluster:
    certificate-authority-data: 
    server: https://testcluster:443
  name: testcluster
contexts:
- context:
    cluster: testcluster
    user: testuser
  name: testcontext
current-context: testcontext
kind: Config
preferences: {}
users:
- name: testuser
  user: 
    exec:
      apiVersion: client.authentication.k8s.io/v1beta1
      args:
      - --region
      - us-east-2
      - eks
      - get-token
      - --cluster-name
      - testcluster
      command: aws
      env: null
      interactiveMode: IfAvailable
      provideClusterInfo: false